RecipeInstructions:
c("Let the ice cream soften either in the refrigerator for a while, or out in the kitchen.", "Line a 8-inch springform tin with clingfilm/clingwrap, both in the bottom and sides of the tin so that you have some overhang at the top.", "Empty the slightly softened ice cream into a bowl and mix in the peanuts, 150g/1 cup chocolate and peanut morsels or chips, Crunchie shards/honeycomb shards and 100g/1 cup of the Bourbon biscuit crumbs/chocolate cookie crumbs.", "Scrape the ice cream mixture into the springform tin flattening the top like a cake, and cover the top with clingfilm/clingwrap and place in the freezer to firm up.", 
"Serve the cake straight from the freezer, unmould from the tin and pulling the clingfilm/clingwrap gently away before putting on a plate or cake stand.", "Sprinkle the top of the cake with the extra 50g/1/4 cup of chocolate and peanut morsels or chips, and the remaining Bourbon biscuit crumbs/chocolate cookie crumbs.", "Cut into slices and serve with the butterscotch and chocolate sauces, letting both dribble lacily over each slice. If 2 sauces sound like too much trouble - they're not - just opt for the chocolate peanut butter sauce. It's hard to find an argument against it."
)

c("In a small saucepan, melt the butter and stir in flour; remove from heat.", "Gradually stir in milk, return to heat and heat to boiling, stirring constantly.", "Boil and stir 1 minute; stir in Cheddar cheese, basil.", "Adjust salt and cayenne pepper to personal taste, remove from heat and keep warm.", "In a nonstick 10-inch skillet over medium heat, brown Canadian bacon on both sides, remove and keep warm.", "Beat the yogurt with with egg substitute and pour into skillet that was used for bacon.", 
"As the egg mixture begins to set at bottom and side, gently lift the cooked portions with spatula so that uncooked portion can flow to bottom.", "Avoid constant stirring.", "Cook 3 to 5 minutes or until thickened throughout but still moist.", "Place 1 slice bacon on each muffin half.", "Divide eggs among the muffin halves, top with about 2 tablespoons sauce, and grate Parmesan cheese on top.", "Add a few grinds of fresh pepper to each serving and sprinkle with freshly snipped chives.", "Serve with fresh fruit for a delightful brunch for 4."
)

c("Bring a large pot of salted water to a boil and cook the asparagus until tender crisp, about 2-3 minutes.", "Remove asparagus with a slotted dpoon and plunge into a bowl of ice water to stop the cooking process.", "When cool, strain the asparagus and cut into 1 inch pieces then set aside.", "Using the same pot, cook the spaghetti until al dente, about 8 minutes (10-12 if using linguine).", "Reserve 1 cup of the pasta water and set aside.", "Drain the pasta.", "Heat the oil in a large saute pan over medium heat.", 
"Add the garlic and saute until fragrant, then add the proscuitto strips.", "Saute until the prosciutto is slightly crisp and add the asparagus, then season with salt if using and freshly ground pepper to taste.", "Add the pasta to the saute pan as well as 1/2 cup of the reserved pasta water, and toss to coat.", "Add the smoked mozzarella and the fresh basil and continue to toss until combined, adding additional pasta water if necessary.", "Turn off the heat and continue to toss.", "The pasta will become creamy as the mozzarella starts to melt."
)

c("Bring a large pot of salted water to a boil over high heat. Heat 3 Tbs. of the olive oil in a 12-inch skillet over moderate heat. Add the garlic, chile flakes, and 2 Tbs. of the parsley and sauté briefly to release the fragrance of the seasonings. Add the tomatoes and fennel seed. Bring to a simmer, adjust the heat to maintain the simmer, and cook, stirring occasionally, until the sauce is thick and well blended, about 10 minute.", "Stir in the minced tuna and then the olives. Season with salt and remove from the heat while you cook the pasta.", 
"Cook the pasta in rapidly boiling water. When the pasta is a few minutes away from being finished, return the tomato sauce to moderate heat and add enough of the hot pasta water -- about 2/3 cup -- to thin the sauce to a nice consistency. Keep the sauce warm over low heat.", "When the pasta is about 1 minute shy of al dente, scoop out and set aside 1/2 cup of the pasta cooking water and then drain the pasta. Return the pasta to the hot pot and stir in the sauce. Cook together over moderately low heat for about 1 min., stirring and adding some of the reserved pasta water if needed to thin the sauce. Take the skillet off the heat and stir in the remaining 1 Tbs. olive oil. Serve the pasta immediately in warm bowls, garnishing each portion with a little of the remaining parsley."
)

c("Heat 2 teaspoons oil in medium skillet over medium heat. Add onion, bell pepper, celery, and garlic and cook until soft, about 5 minutes. Transfer to plate and refrigerate 5 minutes.", "Meanwhile, add remaining ingredients except for the crabmeat, other portion of saltines, and oil. Add the cooled vegetables then gently fold in crabmeat, being careful not to break up large pieces of crab.", "Divide into 12 portions and shape each into 1¼-inch-thick cake and about the shape of your palms. Transfer to plate, cover, and refrigerate until well chilled, at least 30 minutes or up to 1 day.", 
"Heat remaining oil in a large nonstick skillet over medium-high heat. Dredge crab cakes in remaining cracker crumbs and press to adhere crumbs to cakes (coat with crumbs at a time, and cook about 3 per batch in the oil). Gently and carefully place the cakes into the hot oil. Cook until well browned on both sides, about 5 minutes per side (turn cakes gently using two spatulas so as they won't break apart).", "Transfer to plate lined with paper towels to drain excess oil. Repeat with remaining cakes, adding more oil to the pan as necessary. Serve immediately with lemon wedges."
)

c("Preheat the oven to 400 degrees F.", "In a large mixing bowl, combine the flour, baking powder and salt. Mix well.", "Add 1 tablespoon of the cold butter and the cold shortening and work it into the dry ingredients, using your hands, until the mixture resembles coarse crumbs. Stir in the milk. The dough will be sticky.", "Dust your work surface with some flour.", "Turn the dough onto the floured surface. Gently fold each side toward the center. Pick up the dough and dust the work surface with additional flour.", 
"Return the dough to the floured surface and fold each side towards the center again. Turn the dough over and press it out to 1-inch thickness.", "Cut the biscuits, straight down, do not twist the cutter, with a 2 1/4-inch round cookie cutter.", "Melt the remaining tablespoon of butter and add to a 10-inch round cake pan. Place the biscuits in the pan, turning once (to coat both sides with butter), about 1/4-inch apart. Let the biscuits rest for 15 minutes before baking.", "Bake until golden brown, about 15 minutes."
)

c("If using hazelnuts, toast in oven at 350 for a few minutes until fragrant.  Wrap in a clean dish towel and while still warm, rub together in the towel to remove the darker husks.  (I have known a few people allergic to hazelnuts, so I usually omit them.).", "Cut away the stem and remove seeds from dried chipotle pepper, then rehydrate in boiling water.  After is has softened, usually about 10 minutes, remove from the water and drain.", "Using chopping blade in food processor bowl, mince the chipotle.  Add peeled garlic clove and continue mincing.  Next add the roasted red bell pepper and continue chopping.  Add in the Smokehouse Almonds and continue with processing.  I like to get these ingredients as homogenized as possible, in order to finely mince the chipotle and garlic.", 
"Continue to process in the olive oil and the sherry vinegar.  Then adjust seasoning with black pepper and Spanish smoked paprika.", "To keep it just slightly chunky stirr in the canned tomatoes last.  But sometimes they get processed along with the rest.", "Wonderful on halibut, great as a dip for veggies or bread.  Usually when I prepare My Very Favorite Chicken Terrine (see here in Food.com), I will include a small bowl of Romesco Sauce on the platter along with the mustards, cornichon, and olives, because it adds a pretty color to the presentation."
)

c("Blitz the bread into breadcrumbs and soak in half the water.", "Put aside half a red pepper and half the onion, then roughly chop the remainder and place in a large bowl with the chili, tomatoes, cucumber, garlic, mint and olive oil.", "Mix through the breadcrumbs and remainder of the water.", "Blitz with either a hand blender or in batches in a conventional blender until smooth (several minutes).", "If you prefer, you can sieve at this point to make the end result very smooth; I personally prefer the little bit of texture.", 
"Stir through the tabasco and juice of half the lemon and season well (I used about three level teaspoons of salt and the same of black pepper).", "Taste and adjust lemon, tabasco and seasoning as required.", "Chill for at least 4 hours to allow flavours to infuse - it should be served very cold.", "Serve alongside a plate containing the remainder of the red pepper and red onion, very finely chopped, and the hard boiled egg for people to sprinkle on to their taste.", "Garnish with a few small mint leaves and lemon."
)

c("In a large bowl, mix black pepper, garlic powder, rosemary, dry onion soup mix, cream of mushroom soup, cream of celery soup, beef bouillon and hot water.  Set aside.", "In a large frying pan (with deep sides), heat your oil.  Coat your pork chops in flour and add to pan.  Cook until lightly browned and turn over.  Remove pork chops from the pan and pour in your soup mixture.  Whisk to get all the good bits off the frying pan.  Add your pork chops back to the pan.  Simmer on low for 30 minutes (or until your pork chops are cooked through).", 
"CROCK POT VERSION:  Do all steps up to frying up your chops and adding the soup mixture.  Place pork on bottom of crock pot, cover with soup mixture and cook on low for approximately 6 hours.  Add mushrooms the last 30 minutes if desired.", "OVEN VERSION:  Heat oven to 350 degrees.  Do all steps up to frying and adding soup mixture.  Place pork on the bottom of a 9x13 baking dish.  Cover with soup mixture and bake for approximately 30 minutes or until done.", "Serve with mashed potatoes and a veggie --  the sauce makes a fantastic gravy for potatoes!  Hope you enjoy!"
)

c("Prepare a 9-inch springform pan.", "In a double boiler, mix/cook 2 eggs and three egg yolks, lemon juice and sugar until thick, stirring constantly; cool.", "Whip the cream, and fold into cooled lemon mixture.", "Mix together the vanilla wafers and melted margarine or butter (use just enough butter to hold the wafers together, you might use less or more than 1/3 cup).", "Line the bottom and sides of the springform pan with vanilla wafers.", "Pour the lemon mixture into the pan.", "In a bowl beat 3 egg whites until foamy, add in cream of tartar and icing sugar; beat until stiff peaks form.", 
"Spread on the top of the lemon mixture.", "Set oven to broil.", "Brown the meringue under the broiler until brown (watch closely not to burn, and make certain that the egg white topping does not touch the top of the meringue).", "Cover with foil and freeze for 8 or more hours.", "Remove from freezer (taking foil off immediately!) at least 1 hour before serving.", "**NOTE** if using a graham cracker crust mix 2 cups graham cracker crumbs with 1/3 cup plus 2 tablespoons melted butter or margarine and about 1/3 cup sugar."
)

c("Heat the butter in a large heavy pot over moderate heat and add the onions, separating the rings with a fork. Cover and sauté onions, stirring occasionally, for about 10 minutes. Raise the heat to medium high and cook, stirring often, until the onions are very soft and a deep golden brown, about 20 minutes more. Add beef stock, chicken stock, sherry, brown sugar, pepper, thyme, parsley, paprika and scallions. Simmer for 10 minutes, or longer, if desired. To serve, pour soup into warmed bowls, and top with croutons and Swiss cheese.", 
"To clarify butter: Melt butter in a heavy pan over low heat. Skim off froth and carefully pour clear liquid into another container, being careful to leave the milky residue behind.", "Recipe can be halved or doubled.", "At the restaurant we served these in onion bowls -- or very large yellow onions with the root cut off and the insides mostly scraped out(this can be used in the soup) with an ice cream scoop. After toping them with croutons and cheese they were placed under the broiler until bubbling."
)

c("Preheat oven to 350 degrees F. Place parchment paper in the bottom of an 8 inch square baking pan. Butter the parchment and up the sides of the pan.", "Make the crust. In a medium bowl, combine butter, sugar, flour, and salt. Cream it together using a hand mixer on medium low. The ingredients should be evenly distributed, but the mixture will still be crumbly. Pour it into the pan and press it in with your fingers. Bake for 15 minutes, rotating halfway through if necessary, until lightly golden brown. Let cool while you prepare the filling.", 
"Make the filling. In a medium bowl, stir together the eggs, sugar, Biscoff, and flour until there is a homogeneous mixture. Pour into the baked crust.", "Bake for an additional 30 minutes, until the center is just set. Do not check with a toothpick. Let the bars cool completely before slicing and serving. I waited overnight. Store at room temperature for up to 2 days or frozen, wrapped in parchment and foil and placed in a zipper bag for up to 3 months. Thaw at room temperature for about an hour. I’m going to try to warm one of them in a 350 degree F oven for about 10 minutes, but I think it could end very messy. Try this at your own risk."
)

c("Prepare the noodles according to package directions.", "Chop the tomato or tomatoes as you desire. Mine were approx half inch.  Slice the zucchini, thin into half moon shapes.  When I say thin, I mean thin.  Thicker extends cooking times.", "Place the zucchini and the garlic in a well seasoned cast iron skillet or a very well pammed skillet.  Saute them until the zucchini is done.  You must keep stirring to prevent burning.", "When the zucchini is ready add the tomato then savory, basil and pepper.  Stir adding the Braggs.  As it cooks add the Lawry's, lightly.  Keep stirring. Add the noodles.  When you have a fragrant mix, it is done.", 
"Notes:.", "The Noodles used were Rice Stick.", "This is not a dish you can walk away from.  Taste and adjust seasonings. This is vital.  Do not just dump in the teaspoons  Add a little then adjust upward to your taste. Mine happened to be about what you see.  However the seasoning flavors worked heavenly together. To meet your taste, you will taste a bit each step of the way and adjust instead of at the end.  There can be less or more garlic added if you like.  We are garlic fans.  The original was for a version with Soba Noodles from Between Heaven and Earth."
)

c("Line 9 x 13 pan with greased foil, making sure you have overhand on each long side to lift out for easier cutting.", "Preheat oven 350 degrees.", "Place light brown sugar and flour into a bowl, add chilled butter, I usually grate it, and mix with pie blender blade or forks until like peas, as you would a pie crust.", "Transfer topan and bake for 12 minutes.", "In saucepan heat the butter, add the dark brown sugar, honey and syrup, and cream over medium heat and bring to a boil, stirring to make sure all is combined.Once it has come to a full rolling boil time it for one minute, turn off heat. Remove and pour over the cooked base while still hot and bubbling.", 
"Sprinkle the pecans evenly over the topping.", "Return to the 350 degree oven and bake again for another 12 minutes to 15 minutes.", "Until the whole carmelly filling is bubbling all over top.", "Remove from oven.", "Sprinkle with the chocolate chips evenly.  Let sit until melted then swirl over top lightly.", "Let cool completely.", "Lift out of pan, invert, peel off the foil.", "Cut ito bars.", "Store in air tight container, with waxed paper between each layer.", "Stack for gift giving with a small piece of waxed paper between each bar, cello wrap and tie with ribbon.  A nice stack of of five works nicely."
)

c("STOVE TOP.", "1. Wash the beans and soak overnight in cold water. Drain the beans and place in a large pot and add the water and pork hocks. Over medium-high heat, bring the beans to a boil, then cover the pot and reduce the heat to medium-low. Allow the beans to cook until almost tender, approximately 2 hours.", "2. When the beans are cooking, prepare the condiment mix. In a large skillet, heat the vegetable oil over medium heat, add the tomatoes, onions, salt, garlic, cilantro and ground cumin and cook for 10 to 15 minutes.", 
"3. When the beans are almost tender, add the condiment mix, plantains, carrots and salt. Cover and cook for another hour or until the beans are fully cooked.", "CROCK POT.", "Use the same ingredients except use just 4 cups of water instead of 6.", "1. Wash the beans and soak overnight in cold water. Drain the beans and place in a slow cooker, add 4 cups water and pork hocks and cook on high for about 2 hours.", "2. Follow step 2 in the regular pot recipe.", "3. Add the condiment mix, plantains, carrots and salt then cover and cook for another 3 hours. Taste for salt and serve."
)

c("Preheat oven to 350°F", "Mix wafer crumb and butter until well blended; press firmly onto bottom and up sides of 9-inch pie plate.  Bake 5- 8 minutes or until golden brown.  Cool completely; top with bananas.", "Make chocolate curls from 1/2 square of the chocolate; reserve for garnish.  Microwave remaining chocolate and the peanut butter on medium 1-2 minutes; stir until chocolate is completely melted and mixture is well blended.  Drizzle over bananas; set aside.  Pour milk into a large bowl.  Add dry pudding mixes.  Beat with wire whisk 2 minutes or until well blended.  Gently stir in 1 cup of the whipped topping.  Spread over bananas; top with remaining 1 cup of whipped topping.", 
"Refrigerate at least 3 hours or overnight.  Top with chocolate curls and peanuts just before serving.  Store leftovers in refrigerator.", "To keep bananas from browning, brush with lemon juice.", "HOW TO MAKE CHOCOLATE CURLS:  Warm the chocolate slightly by heating it, unwrapped, in the microwave for a few seconds until you can just smudge the chocolate with your thumb.  Hold the square steadily between thumb and fingers of one hand and draw a vegetable peeler slowly over flat bottom of square.  Allow a thin layer of chocolate to curl as it is peeled off the bottom of the square.  This will make long, delicate curls.  Make short curls using the same technique on the narrow sides of the square.  To arange curls on a dessert, use a tothpick to lift them into place."
)

c("Whisk first 7 ingredients together in small bowl to blend. Can be made 2 days ahead. Cover and chill.", "Place potatoes in large ovenproof pot. Pour enough cold water over to cover and add 1 tablespoons coarse salt. Bring to boil over high heat. Reduce heat to medium-high and cook until potatoes are tender when pierced with knife, about 20 minutes. Drain potatoes; reserve pot. Let potatoes stand in strainer until lukewarm, about 20 minutes. Working in batches, press potatoes through potato ricer back into same pot (DO NOT STIR; potatoes should be fluffy). Potatoes can be made 2 hours ahead. Let stand at room temperature.", 
"Preheat oven to 350 degrees. Combine cream, milk, and butter in small saucepan; bring to simmer. Gently fold half of cream mixture into potatoes; repeat with remaining cream mixture. Fold 3/4 cup ranch dressing into potatoes; reserve remaining dressing for serving, if desired. Season potatoes to taste with more coarse salt and freshly ground black pepper.", "Transfer pot with mashed potatoes to oven and rewarm uncovered until potatoes are heated through, about 10 minutes for freshly made potatoes or 30 minutes if potatoes are made ahead. Transfer mashed potatoes to large serving bowl. Drizzle with remaining dressing and serve."
)

c("Heat half the olive oil in a paella pan or a large frying pan. Tip in the pork and cook for about 5 mins until lightly browned, but not cooked through. Remove pork from the pan, then set aside on a plate.", "Pour the remaining olive oil into the pan, then add in the onion, garlic and chorizo. Cook for about 5 mins until the onion is softened and the chorizo is starting to crisp and give off its oil.", "Add the rice and paprika to the pan, then stir around for 1-2 mins until all the grains of rice are well coated. Can be prepared up to this point 1 day in advance and stored in the fridge.", 
"Pour the tomatoes and any juices into the pan along with the pork and 3 2/3 cups of the vegetable stock. Bring to the boil, reduce the heat, then let it gently simmer for about 20 mins until the rice is nearly soft.", "Place the spinach in a sieve, then pour over a kettle of boiling water so the leaves are just wilted. Arrange the spinach leaves in the pan along with the clams.", "Pour over the remaining vegetable stock, then cook for another 10 minutes By this time the clams should have opened (discard any that haven't) and the rice should be tender. Serve straight away from the pan."
)

c("Get your pot of water on the stove and bring to boil.", "While waiting --.", "In a med sauce pan add your sun dried tomatoes. If you can't find them packed in oil, soak sun dried tomatoes in hot water for 20 minute. Drain and chop into thin strips. Also add a tablespoon of olive oil.", "Heat on Med high until tomatoes start to just slightly sizzle in oil. Add onions, celery, and garlic. Saute for 3 minutes.", "Add baby peas, old bay seasoning, black pepper, and italian seasoning. Let cook for another 2 minutes.", 
"Add drained tuna and lemon juice. Stir and let cook for about 2 minutes before adding can of cream of chicken soup and milk. Stir until completely incorperated and let cook on med for about 4-5 minutes.", "Make sure to add pasta once water starts to boil. Cook until al dente. Drain.", "Sauce should be done around the same time as the pasta, if you time it right.", "As soon as you drain pasta, add sauce and pour into a serving / baking dish.", "Sprinkle cheese over the top and it's ready to serve."
)

c("Husk the corn and roast/grill the ears until they just begin to show some char.", "Cut the corn away from the cobs, put corn kernels into a bowl for later, break up the cobs and place into a stock pot.", "Cover the cobs with the water and set to boil for 30-40 minutes in high heat to make corn stock.", "Dice the onion, carrot, jalapeno, garlic and potato and sweat over medium heat with the butter and oil for 10 minutes.", "Add about a quarter of the corn stock and a quarter of the reserved corn kernels to the veggies and simmer for another 15-20 minutes or until the potato is fully cooked and soft.", 
"Add the remaining corn kernels and the chicken base to the remaining corn stock in a medium stock pot.  Simmer for 20 minutes.", "Remove the vegetables from the heat, add the cream and blend using an immersion blender or upright blender until silky smooth.", "Combine both sets of ingredients in the medium stock pot and stir to combine.  Taste to ensure adequate salt.", "The optional ingredients can be used as garnish, I like to use the lime zest and the cayenne powder to make a Mexican Street Corn soup, or the basil and tomato to make is taste fresher/lighter."
)

c("Line a 9-by-9-by-2-inch baking pan with foil, extending foil over edges of pan.", "Butter foil: set aside.", "Melt butter in heavy 3-quart saucepan over low heat.", "Add sugar, sweetened condensed milk, corn syrup and salt, Mix well.", "Carefully clip candy thermometer to side of pan.", "Cook over medium heat, stirring CONSTANTLY until thermometer registers 244F degrees , firm ball stage.", "Reaching firm ball stage should take 15-20 minutes  (be careful, mixture scorches easily).", "Remove from heat.", 
"Remove candy thermometer from saucepan.", "Add anise and color, stir to mix.", "Quickly pour candy without scraping into prepared pan.", "Cool several hours or until firm.", "Use foil to lift and out of pan onto cutting board.", "Peel off and discard foil.", "With buttered sharp knife, cut immediately into one inch squares.", "Wrap individually in waxed paper or plastic wrap.", "Makes 64 pieces, about 2-3/4 pounds.", "NOTE: mixture must be stirred constantly as tiny crystals that form tend to scorch quickly."
)

c("For the hummus:", "Combine the chickpeas and baking soda in a large bowl or pot and cover with at least double their volume of water. Transfer to the refrigerator and soak for 18 hours.", "Drain the chickpeas and rinse thoroughly in cold water. Place the chickpeas in a large pot with the whole head of garlic and cover with water. Bring to a boil, and then reduce the heat to low. Simmer the chickpeas over low heat until very tender, about 3 hours. Drain, reserving 1 cup of the cooking liquid and 1 cup of whole chickpeas. Discard the garlic bulb.", 
"Combine the remaining chickpeas, the sesame paste, grape seed oil and lemon juice in a food processor and puree to a smooth, creamy consistency, adding reserved cooking liquid as needed. Season with salt and cumin.", "For the tehina:", "Combine the sesame paste, water, lemon juice and garlic in a blender and blend at high speed until smooth. Blend in the olive oil. If the puree is too tight, adjust the consistency with additional warm water. Season with salt and cumin.", "For serving:", "Spoon the hummus into a large shallow bowl. Create a well in the center, using the back of a spoon, pushing the hummus to the edges of the bowl. Toss together the reserved whole chickpeas with the tehina in a mixing bowl and adjust the seasoning if necessary. Spoon the dressed chickpeas into the well in the center of the hummus. Garnish the hummus with the olive oil and chopped parsley. Serve immediately."
)

c("Pre-heat over to 375°F.", "Mix nesquick, sugar, and oil in a large bowl until well combined.", "Add the egg and mix in thoroughly.", "Add in the dry ingredients, one at a time, making sure to work out all lumps.", "You want to form a smooth ball of the dough, not sticky, but not too dry.", "Take the cooled ganache and form 24- 1ts balls.", "With your hands, form a (roughly) palm sized \"pancake\" of dough, place a ganeche ball in the center, and wrap it in the dough, and roll it into a ball.", 
"Place the filled dough balls widely apart on a cookie sheet covered with parchment paper.  I fit 12 cookies per sheet.", "Bake at 375F for 10 minutes.  The tops should be slightly cracked, the center WILL be gooey if tested, as the ganache filling is melted :).", "Remove from hot cookie sheet by sliding the parchment paper onto a cool, flat surface.", "Sprinkle the tops of the cookies with powdered sugar, and allow to cool.  Make sure the filling is cool enough to eat before serving, then ENJOY!"
)

c("Combine the bread crumbs, cheese, basil, and one-third of the garlic in a small bowl.", "Pound the beef slices until 1/8 inch thick.", "Sprinkle the beef with 1/2 teaspoon slat and 1/8 teaspoon ground pepper.  Sprinkle he bread-crumb mixture evenly over the beef slices, pressing it so it adheres. Roll up each beef slice beginning with a short side.  Secure each beef roll with a wooden pick.", "Heat the oil in large nonstick skillet over medium-high heat.  Add the beef rolls and cook, turning occasionally, until browned on all sides, about 4 minutes.  Transfer the braciole to a plate.", 
"Add the mushrooms, zucchini, and the remaining garlic, 1/2 teaspoon salt and 1/8 teaspoon ground pepper to the skillet.", "Cook, stirring frequently, until the mushrooms are golden, about 5 minutes.", "Return the beef with any accumulated juices to the skillet and stir in the tomatoes with their juice; bring to a simmer.", "Cook, covered, until the meat is very tender, about 30 minutes.", "Transfer the braciole to a platter; remove the wooden picks.  Spoon the vegetables and sauce around and over the braciole."
)

c("Heat grill to medium-hot.  Place pork tenderloin, wine, garlic, 1/4 teaspoon each of the salt and pepper and the sage ina glass dish.  Marinate, turning, at room temperature for 10 to 15 minutes.", "Bring sweet potatoes and ginger to boiling in a medium-size saucepan filled with lightly salted water.  Cook 12 minutes, or until fork tender.", "Meanwhile, transfer pork to grill, reserving marinade.  Grill over medium-high heat for 13 to 15 minutes, turning twice, until thermometer registers 145°F.", 
"Pour reserved marinade into small saucepan,  Whisk in 1/3 cup water, the flour, mustard, and sugar and bring to a boil over medium-high heat, whisking occasionally.  Once sauce boils, simmer 3 minutes; remove from heat.", "Drain sweet potatoes and transfer to a small bowl.  Add milk, butter, remaining 1/4 teaspoon each salt and pepper.  Mash untill fairly smooth.", "Remove pork from grill; let rest 5 minutes before slicing on the diagonal in 1/2-inch-thick slices and serving with sweet potatoes and sauce."
)

c("To prepare the tofu filling, blend all the ingredients in a food processor or blender until smooth.", "To prepare the TVP filling, pour the boiling water over the textured vegetable protein granules and let stand for about 10 minutes.", "Meanwhile, sauté the onion, green pepper, garlic, basil, and oregano in the olive oil. Add the hydrated granules and soy sauce and sauté for a few minutes.", "Preheat the oven to 350 degrees F.", "To assemble the lasagna, cook the lasagna noodles according to the package directions and drain.", 
"Spread 1 cup marinara sauce over the bottom of a 9 x 13-inch pan.", "Cover the sauce with 4 cooked lasagna noodles and spread the tofu filling evenly over the noodles.", "Cover with 4 more cooked lasagna noodles and about 1 1/2 cups sauce, then spread the textured vegetable protein filling evenly over the layer of sauce. Cover with 4 more cooked lasagna noodles and the rest of the sauce, then cover evenly with the grated soy mozzarella cheese, if desired.", "Cover and bake for about 30 minutes, then uncover and bake for 5 more minutes."
)

c("Generously butter a 1 1/2 quart ovenproof bowl.  Don't skimp here!  If you do, the carrots will stick to the bowl when you unmold it onto a plate.", "Cook carrot slices in boiling water or chicken broth for about 5 minutes.  Remove from heat; drain and cool slightly.", "Cover the bottom and sides of the bowl with carrot slices.  If using peas, cook the peas and arrange the peas between the carrot slices (using whatever design you like).  I prefer to cook the peas and use them as a garnish around the final plated dish.", 
"Meanwhile, peel and cube the potatoes.  Cook in a medium saucepan (uncovered) in boiling water for 10-15 minutes until tender.  Drain.", "In a mixing bowl, mash potatoes.  Mix in eggs, 1/4 cup butter, milk, salt, and white pepper.", "Spoon mashed potatoes into carrot-lined bowl.  Cover with foil.   At this point you can refrigerate up to 24 hours if needed.", "Bake at 350 for 40-45 minutes or until slightly puffed and the center is hot.  Remove from oven; let stand 5 minutes (a must!), then unmold onto a serving plate."
)

c("Dressing: In a bowl, whisk together lemon zest, lemon juice, oil, coriander, cumin and paprika. Season to taste with salt and pepper.", "Salad: Rinse quinoa very thoroughly, about 4-5 times prior to cooking to reduce bitterness.  Do not skip the rinsing step.  In a saucepan, combine quinoa, salt and cold water; bring to a boil over medium-high heat. Stir, reduce heat to low, cover and simmer for about 15 minutes or until water is absorbed and quinoa is tender. Fluff with a fork, spread on a large baking sheet and let cool completely.", 
"Meanwhile, place cranberries and apricots in a small bowl. Cover with warm water and let stand for about 5 minutes or until plump. Drain and set aside.", "Peel avocados and remove seed.  Cut into bite-sized chunks. Place in a bowl and lightly toss to coat with 1 tablespoon of the dressing to prevent discoloration. Place cooled quinoa in a large salad bowl. Add cranberry mixture, avocados, green onions and almonds. Add the remaining dressing and toss to combine.", "Note:  Consider a sprinkle of feta cheese over the top."
)

c("Use your favorite pot that is large enough to prevent boilovers as the candy does need a lot of room to bubble up.", "Pour the buttermilk, sugar, and baking soda in the pot.", "Stir the mixture until the sugar is completely dissolved.", "Place the pot on low to medium burner and let the candy boil to a soft ball stage, stirring constantly all the while.", "The mixture will turn a brownish color but don't worry; it's supposed to.", "Once the soft ball stage is reached,then add two cups pecan halves, a teaspoon of vanilla and butter.", 
"Beat the mixture until it becomes glossy and starts to get very thick.", "Quickly spoon it onto greased wax paper making little patties.", "If you like and have time before the candy hardens, you can turn the pecan halves right side up which makes the patties look prettier.", "Let the candy completely cool before removing it from the paper.", "Should the mixture harden before you've had time to get it all onto the paper, return it to the heat for a few seconds, or until it is again of the right consistency."
)

c("Make the cookie base: Position a rack in the middle of the oven and heat the oven to 350ºF. Put the butter in a food processor, along with the flour, light brown sugar, cinnamon, and salt. Pulse until the mixture is well combined (about 20 pulses). Scatter the dough into a 9x9-inch baking pan and press it evenly over the bottom. (Wipe out the processor bowl but don&#8217;t bother washing it.) Bake the base until firm and lightly browned, about 25 minutes. When the cookie base comes out of the oven, sprinkle the grated chocolate evenly over the top. (Don&#8217;t turn off the oven.) Set the pan aside.", 
"Make the pecan topping: As the cookie base bakes, pulse the pecans in the food processor until coarsely chopped. In a medium-size heavy saucepan, melt the butter. Stir in the dark brown sugar, honey, cream, and salt. Simmer for 1 minute, stirring occasionally. Stir in the pecans. Pour the pecan mixture over the chocolate-sprinkled cookie base, spreading evenly. Bake until much of the filling is bubbling (not just the edges), 16 to 18 minutes. Let cool completely in the pan. When ready to serve, cut into 16 squares. Tightly covered, these bars will keep for about five days (though they never last that long)."
)

c("Preheat the oven to 400°F Heat a large pan misted with low fat oil spray, add the mushrooms and cook over a medium heat for 3 mins until the juices begin to be released.", "Add the garlic and continue cooking for 2 mins or until the juices have evapourated.", "Add the spinach in batches and cook, stirring, until wilted. Remove from the heat and stir in the tomato paste, dried herbs and season with salt and pepper. Cool slightly.", "Using the end of a teaspoon, stuff the cannelloni tubes with the spinach and mushroom mixture and place in a single layer in a baking dish.", 
"Blend 4 tbs of the milk with the cornstarch to make a paste. Bring the rest of the milk to the boil in a pan, then add the cornstarch paste. While stirring, bring it back to the boil and cook until thickened slightly - it should still be quite runny. Remove the pan from the heat, add the mustard and half of each of the cheeses and season with salt and pepper.", "Pour the sauce over the cannelloni, top with the slices of tomato and sprinkle with the remaining cheese.", "Bake for 30 minutes Serve with salad and enjoy!"
)

c("In a food processor, combine all ingredients except the oil. Pulse until a thick paste forms. With processor on, add oil in a slow stream until mixture is well combined.", "Transfer to an airtight container. Press plastic wrap directly onto pesto (to keep basil from browning). Cover with lid; refrigerate up to 4 days or freeze up to 2 months. Divide into an ice cube tray, seal it tightly with plastic wrap and freeze. Later, pop out a cube or two as needed, defrost them in the microwave and use.", 
"Have it your way: Replace the nuts with unsalted roasted sunflower seeds, Nut allergies prepare the pesto without nuts and double the amount of Parmesan, Replace the basil with fresh cilantro or parsley (before transferring the pesto to a container, stir in 2 teaspoons lime juice).", "1 sauce 7 uses: Toss in minestrone or lentil soup, add to marinara sauce, coat fish fillets with pesto then sprinkle with bread crumbs before baking or broiling, spread on a sandwiches, spoon onto grilled lamb or pork chops, brush on chicken breasts before roasting, or combine with boiled new potatoes, steamed greens or sauteed zucchini."
)

c("In a small skillet cook 1/4 cup of the sugar over moderate heat, stirring with a fork, until it is melted and a golden caramel, add carefully 1/4 cup water and simmer the mixture, stirring, until the caramel is dissolved. Remove the skillet from the heat and stir in the chocolate until it is melted. In a bowl whisk the yolks and the whole egg with the remaining 1/4 cup sugar and add the chocolate mixture, whisking.", "Whisk the scalded milk in a steady stream and add the espresso powder, vanilla, and a pinch of salt. Strain the custard through a fine sieve into another bowl, skim the froth, and divide the custard among six 2/3-cup pot de crème pots or ramekins.", 
"Put the pots in a baking pan, add enough hot water to the pan to reach one third up the sides of the pots, and cover the pots with their lids or cover the pan tightly with foil.", "Bake the custards in the middle of a preheated 300°F oven for 30 to 35 minutes, or until they are just set, let them cool completely, uncovered, and chill them, covered, for 3 hours, or until they are cold. The custards may be made 1 day in advance and kept covered and chilled.", "Garnish each custard with a rosette of whipped cream and a chocolate coffee bean."
)

c("Trim the ends off each onion then slice from end to end. Remove peel and finely slice into half moon shapes. Set electric skillet to 300 degrees and add butter. Once butter has melted add a layer of onions and sprinkle with a little salt. Repeat layering onions and salt until all onions are in the skillet. Do not try stirring until onions have sweated down for 15 to 20 minutes. After that, stir occasionally until onions are dark mahogany and reduced to approximately 2 cups. This should take 45 minutes to 1 hour. Do not worry about burning.", 
"Add enough beer to cover the onions and turn heat to high, reducing the beer to a syrup consistency. Add consume, chicken broth, apple cider and bouquet garni. Reduce heat and simmer 15 to 20 minutes.", "Place oven rack in top 1/3 of oven and heat broiler.", "Cut country bread in rounds large enough to fit mouth of oven safe soup crocks. Place the slices on a baking sheet and place under broiler for 1 minute.", "Season soup mixture with salt and pepper. Ladle soup into crocks leaving one inch to the lip. Place bread round, toasted side down, on top of soup and top with grated cheese. Broil until cheese is bubbly and golden, 1 to 2 minutes."
)

c("Put the saffron in small pot with 2 cups stock and about 1/2 cup water. Bring to boil over medium heat, then reduce the heat to low and let steep for a few minutes while you prepare the sausage and onions.", "Heat a skillet with a tight fitting lid over medium-high heat.  Slice vegan sausages about 1 inch thick, on an angle. Add a drizzle of extra-virgin olive oil to the hot skillet and add the slices. Brown evenly on both sides, 2 to 3 minutes total. Set aside.", "Add another drizzle of oil to the skillet along with the onions. Season with salt and pepper, to taste, and cook until softened, about 3 minutes. Add the pimientos and peas and stir to heat through. Deglaze the pan with sherry or wine and stir 1 to 2 minutes. Set aside.", 
"Return the pan to medium heat and melt 2 tablespoons of the butter. Add the pasta and stir until deeply golden brown, about 3 to 4 minutes. Stir in the rice and stock and bring to a boil. Reduce the heat to low, cover the pan and cook for 18 minutes. Fluff the rice with a fork.", "Preheat oven to 375 degrees F.", "Grease a casserole with the remaining 1 tablespoon of softened butter. Fill the casserole with cooked rice and top with the sausage and onion mixture. Put casserole in preheated oven, loosely covered, for 20 minutes. Uncover and bake for about until heated through and barely crispy at edges, about 10 minutes. Top with parsley and serve."
)

c("Combine the soy sauce, mirin, sake, sugar, and ginger in a large zip-top bag.", "Add the beef or chicken and marinate for 2 hours in the refrigerator.", "Remove the meat from the marinade, and pour the marinade into a medium-sized saucepan.  Place over medium heat and reduce until slightly thickened, about 5 minutes.  Reserve 2 tablespoons of reduced marinade and set aside.", "Preheat the broiler.", "For the beef teriyaki:  Slide the beef onto wooden skewers that have been soaked in water for 1 hour and place on a broiler pan.  Place the broiler pan on a rack 6 inches from the broiler and broil for 6 minutes.  Turn the meat over, check for doneness, checking every minute or two.  Brush with the reserved sauce just before serving.", 
"For the chicken teriyaki:  Place the chicken on a broiler pan skin-side down.  Place the broiler pan on a rack 6 inches from the broiler and broil for 3 minutes.  Turn the meat over and baste with the reduced sauce.  Broil another 5 minutes.  The skin should be dark brown in spots and the chicken should be cooked through.  Brush with the reserved sauce just before serving.", "Tip:  Teriyaki is often cooked over a grill.  For this technique, place the marinated meat directly on a barbecue grill rack situated 6 inches over hot coals.  Turn and baste with sauce as directed in the recipe."
)

c("Preheat the oven to 350 degrees. Line a baking sheet with a silicone liner or parchment paper.", "Whisk together the flour and ginger in a small bowl.", "Melt the butter in a small saucepan over medium heat. Add the sugar and golden syrup; cook, stirring, for 1 to 2 minutes, until the sugar has dissolved. Remove from the heat and whisk in the flour-ginger mixture.", "Working fairly quickly to keep the mix from stiffening, spoon 6 level tablespoons onto the prepared baking sheet, spacing them at least 2 inches apart (the cookies will spread quite a bit). Bake for 5 minutes, then rotate the sheet front to back and bake for 5 minutes. The cookies will be flat and golden brown.", 
"Transfer the baking sheet to the stove top (off the heat but in a warm place). Let the cookies rest for 2 minutes, until they are firm but flexible; then, working with one or two at a time, wrap the cookies around a handle to form a tubular shape and transfer to a wire rack to set; this should take about 1 minute. When the cookies are crisp, the handles can be extracted. Let the cookies cool completely before storing.", "Repeat with the remaining batter. Store the molded cookies in an airtight container to maintain their crispness."
)

c("Combine all the green beans and cream of celery in a mixing bowl, carefully to not smash the beans up.", "In a medium-large skillet, fry up bacon pieces until they are crispy and all the fat has melted off.", "Remove bacon from grease and set aside to drain.", "Once drained and cooled a bit crumble into 1/4 inch pieces.", "In the bacon pan and with the bacon grease, blacken (fry) the green onions, and sautee the yellow onion.", "Remove them from the grease when all the green onions are completely black (not burnt), set aside to drain.", 
"Preheat the oven to 350 degrees.", "Add aprox. 15 oz French's Fried Onions, the bacon pieces, yellow onion, and green/black onion into the green beans and carefully stir.", "Transfer the mixture from the bowl into a 8x8 baking dish.", "Evenly spread all of the cheese over the top.", "Then top it off with the remaining French Fried onions.", "Cover with aluminium foil and bake for 20 minutes.", "Remove foil and bake for an additional 10-15 minutes until cheese starts to get brown bubbles.", "Remove from oven and allow to cool 10-15 minutes before serving."
)

c("Peppers  --  first I like to cut them in half, remove the seeds and ribs and then roast the peppers in a 450 degree oven.  Drizzle the olive oil well and place on a cookie sheet covered with foil.  Roast 20-30 minutes until slightly charred.  They make take longer depending on the size. Remove to a bowl and cover with saran wrap.  Let them sit 10-15 minutes.  This will allow the skin to just pull off easily.  Remove the peppers once cooled, peel off the skin and chop.", "Vegetables  --  In a medium sauce pan, melt the butter on medium heat.  Add the scallions, onion,  garlic, corn and cook until well combined.  Then add in the roasted peppers and the jalapeno peppers and cook until well heated through.  Just a couple of minutes is all.  Not too long to heat up.", 
"Transfer the vegetables to a bowl and mix with the remaining ingredients. the cheese and sauce and season with salt and pepper to taste and put in a greased oven proof casserole dish.  I like to spray with pam or you can just use whatever you have on hand.", "Bake  --  In a 350 degree oven, bake the dip 20 minutes until it is bubbly.", "Finish  --  I love to top the dish with a spoon of sour cream, salsa, and chopped olives and serve with tortilla chips.", "The yellow dip with bits of green look so pretty with the melted cheese, bright salsa, olives and sour cream.  It just makes such a pretty creamy cheesy dip.  For me I could eat the whole thing."
)

c("Preheat the oven to 325°F.", "Place the egg whites in a large bowl and using a handheld mixer whip the whites on medium speed for 3 to 4 minutes or until the whites begin to lighten up and hold their shape.", "Increase speed to high and whip in the salt and honey until the whites hold a soft peak, then add the vanilla extract.", "Fold in the yogurt.", "In a separate medium mixing bowl combine the flour and baking powder and mix well.", "Sift the dry ingredients into the egg whites a little at a time, gently folding them in with a rubber spatula.", 
"Once fully incorporated, scoop the batter into cupcake tins lined with cupcake papers.", "Bake the cupcakes for 15 to 20 minutes or until they have colored and gently spring back when pushed with a finger.", "Remove from the oven and cool the cupcakes at room temperature.", "Mix the cream cheese and the banana in a medium mixing bowl until well incorporated, leaving small chunks of banana throughout the frosting.", "Once cool, spread a little of the banana frosting over the cupcakes and top each with a raspberry. Serve."
)

c("Heat oil over medium high heat in a large skillet.", "Add onions; cook until wilted& starting to brown.", "Add sugar, vinegar, salt& pepper.", "Reduce heat& cook gently for 15- 25 minutes or until onions are caramelized& brown.", "Cool.", "Roll pastry into a rectangle approximately 12 x 16 inches. I don't use the sheets of puff pastry - I prefer  to use the 375gm package of Tenderflake Puff Pastry. I start rolling it out on my counter, then I transfer it to my baking tray (which has been lined with parchment paper) and roll the pastry to fit the tray. Since puff pastry is very \"forgiving\", you can \"cut & paste\" if necessary.", 
"Spread onions over pastry.", "Dot with cheese& sprinkle with chervil.", "If you are preparing this for a party, you can prepare to this point and refrigerate- then bake later.", "Bake in preheated 400F oven for 20- 25 minutes or until cheese has melted& pastry is crisp.", "When removed from the oven, it will be puffed right up but allow it to cool for 5 minutes & it will fall back down. Cut into 20 serving pieces - this is easier done with kitchen scissors instead of a knife - then cut each piece in half diagonally."
)

c("Preheat the oven to 350 degrees Fahrenheit.", "Butter a 10 inch springform pan. (I found that buttering the pan was unnecessary since the cookie is quite buttery.).", "In a mixing bowl whisk together the flour, sugar, finely ground blanch almonds, and salt or pulse ingredients together in a food processor.", "Cut the butter into the dry ingredients then about halfway through sprinkle in the extracts and continue to cut until the mixture is fully incorporated and starts to come together, there should be no dried crumbs. Or alternatively you can pulse the butter into the dry ingredients in a food processor.", 
"Squeeze the mixture to form pea to 1 inch size clumps of dough.", "Gently press about 1/4 of the crumbs into bottom of the springform pan. Sprinkle the rest of the mixture evenly over the top.", "Bake until the cookie starts to turn pale golden, about 20 minutes.", "Then lower the temperature to 300 and continue to bake for 20 more minutes until the cookie is dry and crisp.", "Cool on a rack and release from the springform before serving.", "Place on a platter and dust with powdered sugar if preferred."
)

c("Heat oven to 350°F Place water in small saucepan and boil over high heat. Place raisins in small bowl; pour enough boiling water over just to cover raisins. Let stand. In another small bowl, combine curry powder, garam masala, salt and pepper. Reserve.", "In large, oven-proof skillet, cook bacon pieces over medium heat until golden brown, about 3 minutes. Remove with slotted spoon; place on paper towels and drain. Reserve 2 tablespoons bacon fat in skillet. Add chicken to skillet and brown over medium-high heat, turning. (Add excess bacon fat if pan becomes too dry.) Remove chicken thighs to plate and set aside.", 
"In same skillet, add carrots, bell peppers, onion and garlic; cook 6 minutes or until lightly softened. Add tomatoes, spice mixture, ginger, and raisins with the water. Simmer sauce to thicken, about 8 minutes. Place chicken thighs in sauce, skin-up. Tent skillet loosely with foil; transfer to middle rack of oven. Bake 20 minutes. Remove foil from skillet; cook the further thicken sauce, about 15 minutes more.", "Remove chicken from oven. Spoon rice on serving platter; top with chicken thighs and then with tomato sauce. Garnish with bacon pieces, almonds and parsley."
)

c("Equipment:", "1 mold pan", "1 Angel food or Bundt cake pan", "1 Clear glass plate", "1 Small flashlight (I am also thinking you can buy one of those small safety flash red strobe-type lights for night use   the kind that uses the AAA batteries. I have a small one that I use on my bike that may be appropriate for this kind of dish)", "Prepare the gelatin according to package directions and pour into mold or a big  plastic bowl.", "Take a Bundt cake pan or any angel food cake pan with a hollow  cylinder center where you can insert a small flashlight.  Unmold the gelatin  onto the clear glass plate and place the plate atop the cake pan with the  flashlight underneath, standing up.", 
"Turn out the lights!  For extra special  effect, you can put the blinking red strobe light under another small  transparent glass dish or plastic wrap and put that under the gelatin as well.", "Some ideas: blue gelatin with red flashing strobe light lime gelatin with red flashing strobe light layered gelatin mold of red, green, and yellow gelatin with lights under it Halloween Flies Last year there was a similar thread with lots of fun ideas.", "One I remember was  inserting almond slivers into black raisins to make \"flies\", which you suspend  in orange Jello."
)

c("Preheat the broiler. Arrange the tomatoes cut-side up on one half of a rimmed baking sheet and season with salt and pepper. Broil the tomatoes until they begin to soften, about 2 minutes. Remove from the broiler. Arrange the English muffins on the other half of the baking sheet and brush with 1 tablespoon olive oil. Set aside.", "Heat 1 tablespoon olive oil in a large nonstick skillet over medium heat. Add the shallot and cook, stirring, until soft, about 2 minutes. Add the Canadian bacon and cook, stirring, until lightly browned, about 3 minutes. Stir in the spinach until wilted; season with salt and pepper. Transfer the mixture to a bowl; keep warm. Wipe out the skillet.", 
"Heat the remaining 1/2 tablespoon olive oil in the skillet over medium-high heat. Crack the eggs into the pan, season with salt and pepper, and fry until the whites are set but the yolks are still runny, about 5 minutes. Remove the pan from the heat.", "Top the tomatoes with the cheese. Return the tomatoes and English muffins to the broiler; broil until the cheese is melted, 2 to 3 minutes. Divide the English muffins among plates, then top each with some of the spinach mixture and a fried egg. Serve with the broiled tomatoes."
)

c("Bring 2 1/2 quarts of unsalted water to a boil in a 4 1/2-quart Dutch oven or soup pot. When the water reaches a rapid boil, add the rotini and cook until tender, 9 to 11 minutes.", "Meanwhile, pour the Alfredo sauce into a 1-quart glass measure or bowl. Add the wine and milk and whisk well. Set aside.", "Place the oil in a 12-inch nonstick skillet over medium", "heat. Peel and coarsely chop the onion, adding it to the skillet as you chop. Stir from time to time. Rinse the asparagus, cut off the bottom 2 inches of tough stalks and discard. Cut the asparagus spears into thirds. Set aside.", 
"Rinse and seed the bell pepper, and cut it into 1/2-inch dice. Set aside.", "Add the asparagus to the skillet and cook, gently stirring from for 2 minutes. Add the bell peppers and continue to cook and stir for 3 more minutes. Reduce the heat to low and stir in the reserved Alfredo sauce until the vegetables are coated well and the sauce is heated through, about 1 minute. Remove the skillet from the heat.", "When the rotini is done, drain it into a colander and shake to remove as much water as possible. Add the pasta to the skillet and stir and toss to coat well with sauce. Serve at once."
)

c("Cut the spaghetti squash in half, scoop out seeds and bake uncovered in the oven till the fibers are tender and separate easily.", "Cut chicken into half inch cubes and mix in 1 Tbsp soy and cornstarch in a bowl to marinate.", "Mix together and set aside the remaining soy sauce, sherry, sugar and vinegar.", "Heat oil in an uncovered wok at 375 degrees-- In practice I always cook this at as high a heat as possible.", "When hot, add the pepper flakes, stirring until black.", "Add the chicken and stir fry for 2-3 minutes.", 
"Remove chicken with a strainer.", "Add green onion, leek and gingerroot; Stir fry for~1 minute.", "Add the chicken removed earlier to the vegetables and stir fry for another couple of minutes.", "Add the sherry/soy mixture-- (I like for the chicken to appear 95% done before I add the sauce since it will continue to cook for a couple minutes even after turning off the wok or pan) Bring sauce to a low boil for about a minute then remove to a serving dish.", "Serve with Rice or baked spaghetti squash."
)

c("Clean 5-6 large sealer jars with lids.", "Put everything (except the eggs) in a large pot. Bring to a boil and simmer for about 20 minutes.", "To hard-boil the eggs:.", "I recommend bringing the eggs to room temperature first. Put them in a single layer in a large pot, and cover with water.", "Bring the water to a rolling boil, then turn off the heat and cover with a lid.", "Take pot off the heat after 1 minute, and let sit for 17 minutes.", "Plunge eggs into a cold water bath to halt the cooking process.", 
"Once cooled, peel the eggs (give them a smack with a spoon to make peeling easier).", "Fill all jars with boiling water.", "Boil jar lids in a pot for at least 5 minutes.", "Dump out the boiling water and layer the jars alternately with the pepper sauce and eggs.", "Keep the lids boiling in the water. Take one out and immediately put it on a jar. This should create a seal. Make sure the lid \"pops\" down onto the jar.", "Store the jars in a fridge. The eggs should be well flavoured in about 3 weeks. Full saturation will take over a month."
)

c("Build a two-zone fire with Kingsford® charcoal by situating the coals on only one side of the grill, leaving the other side void.  Place the sweet Italian sausage over direct heat and grill for four minutes on each side.  Remove the sausage from the grill and set aside to rest.", "Lightly drizzle olive oil over each batch of vegetables and season with salt and pepper.  Grill each batch of vegetables over direct heat in a grill basket, stirring every two minutes until the soften and brown.  Pour each batch of vegetables into a 9x13-inch baking dish as they are removed from the grill.", 
"Dice the Italian sausage into 1/4-inch pieces and add to the baking dish.  Add the garlic, thyme, rosemary, bay leaf and tomato juice.", "Place the baking dish over indirect heat, close the grill lid, and cook uncovered at 300°F for 35 minutes.  Remove the baking dish from the grill and pour the vegetables into a colander, reserving the juice.  Pour the juice back into the baking dish and reduce by half over the hot coals or until the sauce thickens.  Add the vegetables back into the baking dish and stir coating with the reduced sauce.  Season with salt and pepper and serve."
)

c("Place bacon in a medium-size saucepan set over medium heat. Cook, turning occasionally, until bacon is crispy, about 8 minutes. If bacon browns too quickly, reduce heat to medium-low. Meanwhile, finely chop onion. Remove cores from tomatoes, then coarsely chop.", "When bacon is cooked, remove from pan and place on a paper towel. Drain and discard all but 2 teaspoons (10 mL) fat from pan. Reduce heat to medium-low, then add onion. Stir often until slightly soft, about 4 minutes. Increase heat to medium and add tomatoes along with any juice to pan. Stir in mustard, if using. Using a wooden spoon, scrape up and stir in any brown bits from pan bottom to add flavour. Stir often until tomatoes begin to soften, about 10 minutes. Meanwhile, crumble or slice bacon and set aside.", 
"Increase heat to medium-high. Stir in gin. Cook, stirring often, 2 minutes. Then stir in undiluted soup and 2 soup cans water to dilute it. Stir often until blended and hot, about 3 minutes. Stir in bacon, 1 tablespoon (15 mL) Worcestershire and pepper. Taste, then add remaining Worcestershire, if needed. Serve right away or refrigerate up to 3 days or freeze up to 2 months.", "MARVELOUS MUSHROOMS: This recipe also tastes great with sautéed mushrooms. Finely chop 1/2 pound (250 g) button mushrooms, then add to pan along with onion. Continue with recipe as written above."
)

c("1. Line 12 muffin cups with 12 paper liners. Preheat the oven to 400 degrees F.", "2. Put butter it in a small saucepan on medium heat, stirring until it turns a dark golden color. Take the pan off the heat and cool until it begins to solidy but do not put in the fridge to speed up the process. This won't take that long.", "3. When the butter is solid but still soft place the butter into a large bowl and add brown sugar and eggs. Beat until light and fluffly, about 2 minutes. Add vanilla extract.", 
"4. In another bowl sift dry ingredients. Add to the butter mixture in three parts alternating with a tablespoon of milk each time and ending with the milk. Divide batter among the paper cups, and cook for 15 - 20 minutes. Remove to wire racks to cool.", "5. For the frosting once again burn the butter in the same process listed above in step two. Let it cool and solidify but do not put in the fridge to speed up the process.", "6. Once the butter is solidified but soft place in a bowl and beat it until it is light and fluffy. Add vanilla. Add the confectioners' sugar slowly alternating with the milk until you have reached desired consistency. Smear frosting on cooled cupcakes and enjoy."
)

c("Creme Anglaise:    1.  Set a large fine strainer over a medium bowl and set the bowl in a shallow pan of cold water.", "In a large saucepan, combine the half-and-half and vanilla bean and cook over moderately low heat just until small bubbles appear around the rim, about 5 minutes.", "In another medium bowl, whisk the sugar and egg yolks just until combined. Whisk in half of the hot half-and-half in a thin stream. Pour the mixture into the saucepan and cook over moderate heat, stirring constantly with a wooden spoon, until the sauce has thickened slightly, 4 to 5 minutes. Immediately strain the sauce into the bowl in the cold water bath to stop the cooking. Scrape the vanilla seeds into the sauce. Serve right away or refrigerate until chilled.", 
"Preheat the oven to 425° and butter a 2-quart shallow baking dish. In a large bowl, stir the crème anglaise with the 1/2 cup of dulce de leche and the butter. Whisk in the egg whites. Add the challah, stirring and gently mashing until the cubes are nearly soaked, 2 to 3 minutes. Transfer the bread mixture to the prepared baking dish and bake for about 12 minutes, until firm and bubbling around the edges.", "Heat the broiler. Broil the pudding for 1 to 2 minutes, shifting the dish a few times, until browned all over. Cut the bread pudding into squares, drizzle with dulce de leche and serve."
)

c("Preheat the oven to 425°F Poke some holes in the potatoes with a fork, and then rub each with about a half-teaspoon of canola oil. Place in the oven and cook until very tender, about an hour.", "Meanwhile, pour the remaining 1 tablespoon canola oil into a large skillet set over medium heat. Add the butter. When melted, add the onion. Cook until soft and translucent, about five minutes. Add the garlic and cook for a minute or two until fragrant. Add the mushrooms and cook, stirring occasionally, until they release their water, about 6 minutes.", 
"Pour in the wine, and scrape up anything that has stuck to the bottom of the skillet. Cook until the liquid has mostly evaporated. Pour in the stock and bring to a boil. Reduce to a simmer, add the tarragon and thyme, and cook until slightly thickened. Season the sauce with salt and pepper to taste.", "Remove the potatoes from the oven. Cut a cross in the top of the potatoes and squeeze the ends toward the middle to open the center and fluff them up a bit. Season the inside of the potato with a little salt, and then spoon on the sauce. Garnish with chopped parsley."
)

c("For the bacon-onion jam: Heat the oil in a cast-iron pan on medium heat; add the onion and cook until beginning to brown, 5 to 7 minutes. Add the bacon and thyme and reduce the heat to low. Cook for 10 to 12 minutes, then transfer the bacon and onion from the pan with a slotted spoon into a small saucepot. Reserve the bacon fat in the pan for cooking the tenderloin.", "Put the saucepot with the bacon-onion mixture over medium-low heat and add the brown sugar and coffee. Cook the mixture down to a thick consistency, 25 to 30 minutes. Stir in the apple cider vinegar.", 
"For the pork tenderloin: Preheat the oven to 425 degrees F. Pat the tenderloin dry with paper towels, sprinkle with the garlic powder and season well with salt and pepper.", "Heat the reserved bacon grease in a cast-iron pan over medium-high heat and place the tenderloin in the hot fat. (This comes out even better if you use the same pan you made the jam in; you get all the flavor from the jam.) Sear on all sides, then transfer the pan to the oven to finish cooking to an internal temperature of 135 degrees F, 12 to 15 minutes. Let rest for 5 to 10 minutes before slicing. Serve with the bacon-onion jam."
)

c("Preheat oven to 325*.", "In large kettle or Dutch oven, bring 3 quarts water to a boil, add broccoli.", "Return to a boil, until tender, 3-5 minutes.", "Drain and immediately plunge in icy water to halt cooking,until cold, then drain well.", "Reserve 8 small florets for garnish.", "In small skillet, melt butter over medium heat.", "Saute shallots until transparent, around 5 minutes, cool slightly.", "In food processor bowl, puree broccoli and shallot and butter mixture.", "Add remaining ingredients and process until smooth and creamy.", 
"Can refrigerate this mixture until you are ready to bake.", "Butter 8 (6 oz) ramekins or custard cups, or disposable foil cupcake size cups.", "Divide pureed mixture evenly among ramekins.", "Arrange ramekins in 9 X 13 baking pan, filling pan with boiling water to reach halfway up ramekins.", "Cover loosely with foil.", "Bake in 325* preheated oven until knife in center comes out clean, about 35-40 minutes.", "To serve, run knife around edge of cups, invert on dinner plate.", "Garnish each with a cooked broccoli floret."
)

c("Step 1:  Cut cauliflower, green pepper, green beans and garlic into bite size pieces.  Place in one bowl and set aside.", "Step 2:  In another bowl, cut black olives, green olives, mushrooms, carrots, artichokes, into bite size pieces.  Add capers.  Set aside.", "Step 3:  Combine anchovies, shrimp and tuna.  Set aside.", "Preheat oven to 200.", "Wash jars in warm soapy water, rinse well with clean water and place in oven to air dry.  Turn oven off.", "In a large stock pot, over medium high heat, add olive oil; heat.  Add ingredients in Step 1 and cook until tender; 6 - 8 minutes.", 
"Add ingredients for Step 2 and saute until well heated through; about 5 - 8 minutes.", "Add ketchup, chili sauce, hot pepper sauce and white wine vinegar and bring to a boil.  Reduce heat and simmer for 10 - 15 minutes.", "For Step 3, rinse and cut anchovies into small pieces.  Pour boiling water over the seafood, drain well and add to the pot.  Simmer for 5 minutes.  Taste and adjust seasonings.", "Fill hot jars with the antipasto; cleaning the rim with a clean cloth and top with steralized lids.  Process the jars in boiling water for 10 minutes."
)

c("Pat chicken dry and season with salt and pepper. Heat 2 tsp oil in a large skillet over medium high heat until shimmering. Add chicken pieces skin side down and cook without moving until golden brown, 5-8 minutes.", "Using tongs, flip chicken pieces skin side up. Reduce heat to medium low, add broth to skillet, cover, and cook until it reaches an internal temperature of 165°, 10-16 minutes. Transfer chicken to a plate.", "Pour off liquid into 2-cup measuring cup and reserve. Wipe skillet with paper towels. Add remaining teaspoon oil and heat over medium high heat until it is shimmering. Return chicken skin side down to skillet and cook undisturbed until skin is deep golden brown and crisp and internal temp is 160°, 4-7 minutes. Transfer to heated plates and tent loosely with foil. Skim fat from reserved cooking liquid and add enough additional broth to yield 3/4 cup.", 
"To the skillet add 1/2 the lime juice, sugar, garlic, fish sauce and curry paste. Cook over medium high heat, scraping bottom of the pan with a wooden spoon until the spoon leaves a wide trail in the sauce, about 2 minutes.", "Add reserved cooking liquid; return to simmer and cook until reduced to 1/3 cup, 2-3 minutes. Stir in any juices from the resting chicken; return to simmer and cook 30 seconds. Off heat, stir in cilantro and remaining lime juice. Pour sauce around chicken and serve immediately."
)

c("Mix together pork, green onions, cilantro, ginger, mushrooms, soy sauce, sesame oil, sugar, cornstarch and egg white in a large bowl until well combined.", "Working with 6 wrappers at a time, use fingertip to wet edges of each wrapper with water.", "Top each wrapper with 2 teaspoons pork mixture.", "Bring the 4 corners up towards the top of the filling, pleat the sides of the wrapper to form a cup, and press the wrapper snugly around the filling. The dumpling does not need to be fully enclosed at the top.", 
"Keep the dumplings covered with dampened tea towel while working.", "Place a bamboo steamer in a large pot and add enough water to come just below the base of the bottom steamer.", "Line each basket with a single layer of cabbage leaves to prevent the dumplings from sticking; important, do not omit or you will be eating of the steamer :).", "Place a single layer of dumplings on top of leaves.", "Cover and simmer for 8 minutes or until pork is cooked through; do not overcook.", "Serve warm with Recipe #397489 or other dip."
)

c("Preheat oven to 350°.", "Place almonds into a 8 or 9-inch square pan; bake until golden, 10-15 minutes.  Let cool.", "Coarsely chop almonds, set aside for now.", "In large bowl, using electric mixer, beat sugar, butter, molasses and ginger until smooth.", "Add eggs, one at a time, beating after each addition.", "In a bowl, stir flour, baking powder, cinnamon, nutmeg, cloves, allspice and the almonds.", "Add into the egg mixture; stir to blend.", "On 2 greased 12x15-inch baking sheets with floured hands, pat dough into 4 flat loaves.", 
"Space evenly on sheets; each loaf about 1/2-inch thick, 2 inches wide and the length of the baking sheet.", "Bake until browned at edges and springy to the touch, about 25 minutes. Switch positions of pans halfway through baking.", "Let loaves stand on sheets until cool enough to touch, then cut into long, 1/2-inch thick diagonal slices.", "On baking sheets, arrange slices close together with cut side down.", "Return to oven bake 15 to 18 minutes longer; switch positions of pans halfway through baking."
)

c("Wash the eggplants, remove the stalk, and slice lengthwise into quarters.", "Cut each quarter lengthwise into 1\" wide strips and then crosswise into 1\" cubes.", "Heat 1-2 inches of peanut oil in a wok to medium-high heat (375F) and deep-fry the eggplant cubes in batches until golden brown (this takes around three to five minutes for each batch, adjusting oil temperature as necessary).", "Drain thoroughly on kitchen paper.", "In a medium-sized pan, heat the extra oil and saute and stir the onion until golden brown.", 
"Add the turmeric, cumin, coriander and mustard and stir for a couple of seconds before adding the garlic, ginger, chillies and curry leaves.", "Stir and saute for 30 seconds.", "Add the vinegar, coconut milk, salt to taste and the sugar and stir until well mixed.", "Bring slowly to the boil before adding the deep-fried eggplant cubes.", "Stir, then simmer gently on low heat until most of the liquid has evaporated, about 10 minutes.", "Taste and season with a little more sugar and/or salt as desired."
)

c("After you have made this once, you can play with the ingredients- I like TONS of broccoli and just a little Spam and Cheese.", "Preheat oven to 375°.", "Cut broccoli into bite size pieces.", "Place in large microwaveable bowl.", "Add 2 Tablespoons water and the chopped onion.", "Microwave approx 1 1/2 minutes (Just to\"tenderize\" the broccoli).", "Cut Spam into tiny cubes and saute in small frying pan just to brown the meat.", "Remove Broccoli from microwave, drain the water off and add the mustard, spam& cheese.", 
"Cover a cookie sheet pan with foil.", "Unroll the crescent rolls and place in a circle on the sheet pan.", "The wide ends of the rolls should be overlapping in the middle with the pointed ends hanging off the side of the pan (See Photos).", "Place the Spam mixture in a circle around the wide ends on the cookie sheet.", "Fold the pointed ends over the mixture and tuck underneath.", "Bake for 25 minutes or until the crescent rolls are golden brown.", "(Lift one of the rolls and look underneath to be sure it has browned and is not mushy or raw dough)."
)

c("Remove crusts from bread; reserve for another use.", "With rolling pin, lightly roll slices to flatten.", "Press into lightly buttered muffin cups to form cups with 4 points.", "Brush lightly and sparingly with melted butter.", "Bake in 375f degree oven for 5 to 8 minutes or until light golden.", "(Toasted cups can be made ahead and stored in plastic bags in refriferator for up to 4 days. Return them to muffin cups before filling and baking.) In skillet, heat remaining butter over medium heat; cook onion and garlic (if using), stirring occasionally.", 
"Add mushrooms and sausage; cook,stirring occasionally, for about 8 minutes or until sausage is no longer pink.", "Add flour, salt, thyme, marjoram and pepper.", "Stir until flour is blended with drippings.", "Add cream and lemon juice; cook, stirring, for about 2 minutes or until mixture thickens.", "Taste and add more salt, thyme or marjoram, if necessary.", "Spoon sausage mixture into toasted cups and sprinkle with Parmesan.", "Bake in 375f degree oven for 5 to7 minutes or until heated through."
)

c("In a soup kettle, combine the dried potato slices, bouillon, and 5 cups water.  Let sit about 5 minutes to absorb some of the liquid.  Add the dried tomatoes, carrots, green beans, peppers, mushrooms, onions, and all the seasonings.  Bring the mixture to a boil over high heat.  Remove the kettle from the heat, cover, and let sit for at least 15 minutes to rehydrate.", "Return the kettle to the heat, bring the soup to a boil, and let it simmer slowly, stirring occasionally, for at least 1 hour until the vegetables are soft, adding water if necessary.", 
"In a pitcher, stir together the 2 cups cold water and the dry milk.  Bring the soup to a boil and stir in the milk.  Reduce the heat to low and gradually stir in the potato flakes.  Stir constantly, to prevent the soup from scorching, for about 5 minutes.  Top with Parmesan cheese before serving.", "Homemade Potato Flakes:  Spread cooked mashed potatoes on lightly oiled leather sheets, place in the dehydrator, and dry.  Break the sheets into chunks, put in the blender, and pulse until ground into flakes."
)

c("Preheat oven to 300°F.", "You will need 3-4 glass baking dishes approximately 9x13 inches.", "In a large metal roaster/pan, Mix the first 8 ingredients together, make sure all the fruit in coated with the flour; set aside.", "Bring water to a low boil, pour into a small glass mixing bowl and add the almond paste; set aside.", "In a large glass mixing bowl add together the next 7 ingredients & whisk until emulsified & cloudy, stir the almond paste & water mixture, and add to wet ingredients & whisk briefly.", 
"Pour the wet ingredients over the dry ingredients and mix until all dry is covered with wet. This will take about 10 minutes.", "Divide the granola into the baking dishes, making sure not to add more than 1 inch to any one pan.  Bake for 1 hour, stirring well every 15 minutes and rotating the lower rack to the upper rack as well.", "Remover pans from oven and stir once again.", "Let cool completely in pans. Store in tight close containers, can be frozen for up to 6 months and taken out as needed."
)

c("Preheat oven to 350°F (180°C).", "Mix all dry ingredients together well. Stir in the oil and begin stirring in water a little at a time. The dough will need to be formed into a ball, if it is too dry add a little more water, if too wet, more flour.", "Divide the dough in half and roll each half into a ball.", "Use a Silpat or cut a generous amount of plastic wrap and dust it with a gluten-free flour. Flatten one ball into a rectangle, place  it on the Silpat or plastic wrap and sprinkle with some more flour. Place another large piece of plastic wrap on the dough and using a rolling pin, roll the dough out as thinly as possible. It might be necessary to peel off the top layer of plastic and re-dust a few times.", 
"Peel off the top layer of plastic, dust with a little more flour, place a baking sheet over it, slide another baking sheet under the bottom plastic wrap, flip over, remove the other sheet of plastic wrap and bake.", "A nice touch, although not necessary, is to glaze the crackers before baking with an egg white or cornstarch glaze.", "Mine were a little less than an eighth of an inch, but less is literally more! Crackers, that is.", "Bake for approximately 12-15 minutes, until lightly browned and crispy. They will crisp up more after they cool off. After cooled, store in an airtight container."
)

c("Preheat oven to 350 degrees.  Mix first 6 ingredients in a small bowl.  Rub spice blend over beef.", "Cook bacon in a heavy large ovenproof pot over medium heat until browned and lightly crisp.  Using a slotted spoon, transfer bacon to paper towels to drain.  Pour off all but 2 tablespoons drippings from pot.", "Increase heat to medium-high.  Add beef and cook until browned on all sides, about 12 minutes total.  Transfer beef to a plate.", "Add red wine to pot; bring to a boil, scraping up browned bits.  Boil until reduced to 1/2 cup, about 5 minutes.", 
"Add broth and bacon.  Place beef atop bacon.  Scatter onions, shallots, garlic and bay leaves around beef.", "Cover pot, transfer to oven, and roast 1 hour.  Turn beef over; stir onions.  Cover and roast 1 hour longer, adding water by 1/4 cupfuls if dry.  Transfer beef to plate.", "Add carrots, parsnips and celery root to pot; stir to coat.  Place beef atop vegetables, cover and roast until beef and vegetables are tender, about 45 minutes longer.", "Transfer beef to platter.  Spoon off fat from surface of sauce.  Season sauce to taste with salt and pepper.  Pour sauce over beef and serve."
)

c("Bring a large saucepan of heavily salted water to a boil over high heat. Add the noodles, stir to separate them, and boil until cooked through, about 5 minutes. Drain in a colander and rinse under cold water until cool. Using scissors, cut the noodles into 6- to 8-inch lengths. With the noodles still in the colander, drizzle with 2 teaspoons of the sesame oil and toss to coat; set aside.", "Mix the soy sauce and sugar together in a small bowl until the sugar has dissolved; set aside.", "Heat the 1 tablespoon vegetable oil in a large frying pan over medium heat until shimmering. Add the carrots, onion, measured salt, and measured pepper. Cook, stirring occasionally, until the onion has softened, about 8 minutes. Add the mushrooms and garlic and cook, stirring occasionally, until the mushrooms are tender, about 3 minutes.", 
"Increase the heat to medium high. Add the spinach and, using tongs, toss to combine. Let cook until slightly wilted, about 1 minute. Add the reserved noodles and soy sauce mixture and toss until heated through, about 2 to 3 minutes. Remove the pan from the heat, add the remaining 2 teaspoons toasted sesame oil and toss to combine. Taste and season with salt and pepper as needed. Transfer to a serving platter and sprinkle with the scallion and sesame seeds. Serve immediately or at room temperature."
)

c("Line 4 miniature muffin pans with candy cups; set them aside. (Or you can skip the paper candy cups and just drop these by the spoonful onto wax paper lined cookie sheets.).", "Heat the oven to 350 degrees. Spread the coconut and nuts on separate cookie sheets.", "Bake each until golden brown, about 9 minutes for the nuts and 10 for the coconut, stirring every few minutes to keep them from burning. Let them cool.", "Combine the toasted coconut and nuts in a medium-size bowl. Melt the chocolate chips in the microwave according to the package directions.", 
"Add the melted chocolate to the coconut mixture; stir well. Drop the mixture by heaping teaspoonfuls into the candy cups (or directly onto lined cookie sheets). Chill until set, about 45 minutes.", "If desired, melt additional chocolate according to the package directions.", "Pour the contents into a zipper bag. Snip off a small corner of the bag, then drizzle the chocolate over the clusters.", "Chill until drizzle is set, about 15 minutes.", "Store in an airtight container in the refrigerator."
)

c("Heat oven to 200 degrees Celsius.", "Melt butter in a large saucepan.  Add the chopped leeks and cook gently until the leeks are soft but not brown.", "Stir in flour and mustard.", "Add the milk a little at a time stirring thoroughly to create a thick, glosy sauce.  Season with salt and a little pepper.", "Add the egg yolks and beat well with a wooden spoon until completely incorporated.", "Add the cheese and stir until the cheese is melted.", "In a separate bowl beat the egg whites until stiff and firmly set.", 
"Using a metal spoon, stir 2 tbsp of the egg whites into the soufle base to loosen the mix.  Carefully fold in the remaining egg whites in two parts.  Be very gentle and try to retainas much volume as possible.", "Lightly grease 6 individual ramekin dishes with a little butter.  Gently spoon the mixture into the dishes filling to within 1 cm of the top.", "Place the ramekins onto a bakingsheet and cook in a preheated oven for 15 minutes or until the souffles are golden and risen.", "Serve immediately with a green salad and crusty bread.  Be quick though, the souffle will sink in a few minutes."
)

c("In shallow bowl, combine flour, salt and pepper, mix well.  Add beef pieces, turn to coat both sides.", "Spray large nonstick skillet with nonstick cooking spray.", "Heat over medium-high heat until hot.  Add beef; cook 4 to 6 minutes or until browned, turning once.  Remove beef from skillet; cover to keep warm.", "In 3-1/2 to 4-quart slow cooker, combine potatoes, carrots and onion; mix well.  Add bay leaf.  Place browned beef over vegetables, in small bowl, combine 1-1/2 cups of the broth (reserve and refrigerate remaining broth) and Worcestershire sauce.  Pour over beef.", 
"Cover; cook on Low setting 8 to 10 hours.", "About 5 minutes before serving with slotted spoon; remove beef and vegetables from slow cooker; place on serving platter.  Cover to keep warm.", "Pour liquid from slow cooker into medium saucepan; remove and discard bay leaf.  In small bowl, blend remaining broth and cornstarch until smooth.  Add to liquid in saucepan.  Bring to a boil over medium-high heat; stirring constantly.  Boil 1 minute.", "Serve sauce with beef and vegetables.", "If desired, season to taste with salt and pepper."
)

c("Preheat oven to 425F thirty minutes before baking, and place a baking stone, baking tiles, an inverted large cast-iron skillet or griddle, or a heavy baking sheet in oven to heat (I use a baking stone).", "Flour the work surface lightly and roll the dough into a rough circle 11 inches in diameter. Place a sheet of parchment paper roughly the size of the dough on a baker's peel (this is what I use), inverted baking sheet, or a rimless cookie sheet. Transfer dough to the parchment; reshape with your fingers.", 
"Prick the dough with a fork and brush lightly with some of the olive oil. Grind pepper over it and sprinkle evenly with the rosemary. Cut the lemon in half lengthwise through the stem (reserve other half for another use), then slice crosswise as thinly as you can; remove any seeds. Arrange lemon slices evenly over the dough and brush them lightly with olive oil. Cover loosely with plastic wrap and set aside to rise for 15 minutes.", "Slide the focaccia, still on the parchment, onto the hot stone. Bake until the crust is puffed and golden brown, about 20 minutes. Brush with remaining oil and sprinkle with the cheese or salt. Cut into wedges and serve at once."
)

c("prep: Cut chicken into 1-inch chunks. Remove stem and seeds from bell peppers. Finely chop bell peppers, Onion, garlic, and ortega chiles.", "Use a large, deep pan. Drizzle 1 tbsp olive oil into it, and heat the pan.  Please note that spices are put in twice: once with the chicken, and once with the rice, so don't put them away after the first measurement.", "Place chicken in heated pan.  Sprinkle  ¼ tsp chili powder, ¾ tsp cumin, and ¼ tsp onion powder over chicken, stirring frequently, until chicken is thoroughly heated.", 
"Remove chicken from pan.  Add the remaining tbsp of olive oil and the pepper mixture.  Cook, stirring constantly, for approximately 6 minutes, until onion is soft and liquid has reduced out and disappeared, I don't use salt/pepper during this step, since there is enough in the rotisserie chicken already.", "Add the chicken broth,  salsa, diced tomatoes, chili powder, and cumin to the pepper mixture.  Bring to a boil.", "Stir in the rice, and put the chicken back in the pan, along with any juices that may have left the chicken.  Cover and cook for approximately 10 minutes, stir in the frozen peas and cook for an additional 10 minutes or until rice is tender."
)

c("Using a small spoon, delicately scoop out and discard the dark brown gills from the underside of each mushroom. Wipe mushrooms gently with a moist paper towel to remove any remaining debris then transfer to a wide, shallow baking dish along with the pineapple rings.", "Put 3/4 cup of the reserved pineapple juice (save remaining for another use), soy sauce, sugar, garlic, ginger and sesame oil into a small bowl and whisk together to make a marinade.", "Pour marinade over mushrooms and pineapple, cover and set aside, turning occasionally, for 1 to 2 hours.", 
"Grease grill grates with canola oil and preheat to medium high heat. Meanwhile, drain leftover marinade from mushrooms and pineapple and transfer to a small saucepan; bring to a boil over medium high heat. In a small bowl, stir together water and cornstarch then whisk into marinade and boil until thickened, about 1 minute more; set aside.", "Working in batches, grill mushrooms and pineapple, gently flipping once, until hot throughout and tender, 3 to 5 minutes.", "Transfer to buns, top with lettuce and serve with teriyaki sauce on the side, if you like."
)

c("Combine cinnamon, cumin, ginger, cloves, nutmeg, turmeric, curry powder, and salt in a large bowl, reserve.", "Melt butter in a large pot over medium heat. Cook the onion in the butter until soft and just beginning to brown, 5 to 10 minutes. Stir in the shredded kale and reserved spice mixture. Cook for 2 minutes or until kale begins to wilt and spices are fragrant.", "Pour the vegetable broth into the pot. Stir in the tomatoes, honey, carrots, sweet potatoes, potatoes, garbanzo beans, dried apricots, and lentils. Bring to boil; reduce heat to low.", 
"Simmer stew for 30 minutes or until the vegetables and lentils are cooked and tender.", "Season with black pepper to taste. If desired, combine optional cornstarch and water; stir into stew.", "Simmer until stew has thickened, about 5 minutes.", "*Make Ahead Tip: If making ahead or freezing, prepare stew through Step 3. Simmer for 5 minutes over low heat; remove from heat and cool in the pot or in freezer-safe container. Transfer to the fridge (store for up to 3 days) or freezer. The vegetables store better if not fully-cooked prior to refrigeration or freezing. When ready to eat, (if frozen) thaw in refrigerator for 24 to 48 hours, then pour stew into a pot, bring just to a boil, and simmer until heated through."
)

c("Season the eggplant slices liberally with salt. Fan out in a large colander. Set a large bowl inside, weighted with cans, to help press the excess liquid and bitterness from the eggplant. After about 20 minutes, rinse and drain the eggplant, and pat dry.", "Preheat oven to 400 degrees F. In a large skillet, heat about 1/4 inch of vegetable oil over medium--high heat. When the oil is hot but not smoking, dredge the eggplant in flour, tapping off the excess, and fry in batches until browned and crisp on both sides, about 2 minutes per side. Drain on paper towels. Season the zucchini with the 1/2 teaspoon salt, and dredge in flour. Fry until browned and crisp on both sides, about 2 minutes per side. Drain with the eggplant.", 
"Grease an 8x8 inch ceramic or glass baking dish with the butter. In a bowl, toss together the mozzarella and Grana Padano. Spread 1/2 cup of the marinara sauce in the bottom of the dish. Fan out a layer of half the vegetables, like shingles. Sprinkle with half of the cheese. Spread another 1/2 cup of the sauce. Fan the remaining vegetables out, then cover with the remaining sauce, and sprinkle the top with the remaining cheese. Bake, uncovered, until bubbly and the cheese is browned and crusty, about 30 minutes."
)

c("Preheat oven to 425°.", "Heat 1 tablespoon of the oil in a 12-inch skillet over moderately high heat for 1 minute.", "Add the red pepper and zucchini and sauté, stirring occasionally until soft, about 5 minutes.", "Stir in the garlic, black pepper and basil, and sauté 2 minutes longer.", "Add the sausage, breaking up any clumps, and sauté until no longer pink but not quite cooked through, about 5 minutes.  Remove from heat.", "Toss the potatoes with the remaining 1 tablespoon oil.", "Spread 1/4 of the potatoes, overlapping slightly, over the bottom of a lightly greased 10-inch pie pan or a 13\" x 9\" x 2\" baking dish.", 
"Spread 1/3 of the skillet mixture on top, followed by 1/3 each of the Parmesan and mozzarella cheeses.  Press each layer down with your hands.", "Repeat the layers twice, finishing with a top layer of potatoes.", "Cover the pie with foil, set in the lower third of the oven, and bake for 40 minutes.", "Remove the foil and bake until the potatoes are crisp and cooked through, 5 to 10 minutes more.", "Remove the pie from oven and let stand for 10 minutes at room temperature.  Carefully pour off any fat, then cut the pie into wedges.  Serves 6."
)

c("Cut the pork tenderloin into 4 equal pieces using a sharp knife.  Place between 2 sheets of wax paper and pound each piece with a meat mallet or the end of a rolling pin to flatten.", "Cut a horizontal slit in each piece of pork to make a pocket.", "Optional: Lightly toast almonds until a preheated broiled for 2-3 minutes, or until golden brown.", "Mix the almonds with 1 Tbsp olive oil, the prosciutto, garlic, oregano, and finely grated rind from 1 lemon.  Spoon the mixture into the pockets of the pork.", 
"Heat the remaining olive oil in a large skillet.  Add the chopped shallots and saute for 2 minutes.", "Add the pork to the skillet and cook for 2 minutes on each side or until browned all over.", "Add the stock to the skillet, bring to a boil, cover, and reduce heat slightly simmer for 45 minutes, or until the pork is tender.", "Remove the meat from the skillet, set aside, and keep warm.", "Add the finely grated rind from the 2nd lemon and the sugar to the pan and boil for 3-4 minutes, or until reduced and syrupy.  Pour over the pork tenderloin and serve immediately."
)
